import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'

class Footer extends Component {

  constructor( props )
  {

    super();

  }

  processLinks( arr_links )
  {

    return arr_links.map( ( link ) => {
      return (
        <Link to={link.link}>
          <li>{link.title}</li>
        </Link>
      );
    });

  }

  processCollums( arr_collums )
  {

    return arr_collums.map( ( collum ) => {

      return (
        <div data-container-collum>
          <div data-title>{collum.title}</div>
          <ul>
            {this.processLinks( collum.links )}
          </ul>
        </div>
      );

    });

  }

  processTermlink( links )
  {

    return links.map( ( link ) => {
      return (
        <Link to={link.link}>
          <li>{link.title}</li>
        </Link>
      );
    });

  }

  render() {

    let { footer_texts } = this.props;

    return (
      <div data-component="footer" className="">

          <div className="container-page hidden">

            <div data-container-logo>

              <i data-logo>
                <i className="icon-coins"></i>
                <p>
                  Oliveira
                  <span>Capital</span>
                </p>
              </i>

            </div>

            <div data-container-collums>
              { this.processCollums( footer_texts.collums ) }
            </div>

          </div>

          <div data-copy>

            <div className="container-page hidden">

              <p>{footer_texts.subfooter.copy} {new Date().getFullYear()}</p>

              <ul>
                {this.processTermlink( footer_texts.subfooter.links )}
              </ul>

            </div>

          </div>

      </div>
    );
  }
}
export default Footer;
